    if (!gl) alert("WebGL 2.0 isn't available");
    program = initShaders(gl, "vertex-shader", "fragment-shader");
    gl.useProgram(program);

    gl.viewport(0, 0, canvas.width, canvas.height);
    //background-color: rgb(43, 46, 46); in hmtl
    var red = 43/255;
    var green = 46/255;
    var blue = 46/255;
    gl.clearColor(red, green, blue, 1.0); //bg color
    gl.enable(gl.DEPTH_TEST);
    gl.enable(gl.CULL_FACE);

    //////////////////////////////////////////scene//////////////////////////////////////////
    
    ///////////////////// buffers //////////////////////
    var vBuffer = gl.createBuffer();
    gl.bindBuffer(gl.ARRAY_BUFFER, vBuffer);
    gl.bufferData(gl.ARRAY_BUFFER, flatten(PositionsArray), gl.STATIC_DRAW);
    var positionLoc = gl.getAttribLocation(program, "aPosition");
    //gl.vertexAttribPointer(positionLoc, 4, gl.FLOAT, false, 0, 0);
    gl.vertexAttribPointer(positionLoc, 4, gl.FLOAT, false, 0, 0);
    gl.enableVertexAttribArray(positionLoc);

    var nBuffer = gl.createBuffer();
    gl.bindBuffer(gl.ARRAY_BUFFER, nBuffer);
    gl.bufferData(gl.ARRAY_BUFFER, flatten(NormalsArray), gl.STATIC_DRAW);
    var normalLoc = gl.getAttribLocation(program, "aNormal");
    gl.vertexAttribPointer(normalLoc, 3, gl.FLOAT, false, 0, 0);
    gl.enableVertexAttribArray(normalLoc);
    
    nMatrixLoc = gl.getUniformLocation( program, "normalMatrix" );


    /////////////////////cube and floor translations //////////////////////
    translationLoc = gl.getUniformLocation(program, "translation");

    //////////////////////////////////eye////////////////////////

        //ideal eye
